import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

class Navbar extends Component {
    state = {  } 
    render() { 
        return (
            <nav class="navbar navbar-expand-lg navbar-light bg-light">
                <a class="navbar-brand" href="#">BalmCo</a>
                <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                    <span class="navbar-toggler-icon"></span>
                </button>
                <div class="collapse navbar-collapse" id="navbarNav">
                    <ul class="navbar-nav">
                        <li class="nav-item active">
                            <a class="nav-link" href="#">Home <span class="sr-only">(current)</span></a>
                        </li>
                        <li class="nav-item">
                            <a class="nav-link" href="#">Features</a>
                        </li>
                        <li>
                            <a style={{color: "red", marginRight: "1300px"}}></a>
                        </li>
                        <li>
                            <button 
                                style={{color: "red", marginRight: "6px"}}
                                class="btn btn-outline-primary" href="#">Patient</button>
                        </li>
                        <li>
                            <button 
                                style={{marginRight: "6px"}}
                                class="btn btn-outline-primary" href="#">Physician</button>
                        </li>
                    </ul>
                </div>
            </nav>
        );
    }
}
 
export default Navbar;
